import { useState } from "react";

const prices = ({ bpi }) => {
  const [state, setState] = useState({
    currency: "USD"
  });
  console.log(bpi);
  return (
    <div>
      <ul className="listgroup">
        <li className="list-group-item">Bitcoin rate for {bpi.USD}</li>
      </ul>
    </div>
  );
};

export default prices;
